// src/pages/SuperAdminDashboard.js

import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function SuperAdminDashboard() {
  const [schools, setSchools] = useState([]);
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);

  const token = localStorage.getItem('token');

  useEffect(() => {
    async function fetchData() {
      try {
        // Get all schools
        const schoolRes = await axios.get('http://localhost:5000/api/schools', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setSchools(schoolRes.data.schools || schoolRes.data);

        // Get all users
        const userRes = await axios.get('http://localhost:5000/api/users', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setUsers(userRes.data.users || userRes.data);

        setLoading(false);
      } catch (e) {
        alert("Error loading data. Please check your token or backend.");
      }
    }
    fetchData();
  }, [token]);

  if (loading) return <div className="p-10">Loading dashboard...</div>;

  return (
    <div className="min-h-screen bg-blue-50 flex flex-col items-center py-10">
      <h2 className="text-2xl font-bold mb-4">Super Admin Dashboard</h2>
      <div className="bg-white rounded-xl shadow p-6 w-full max-w-4xl mb-8">
        <h3 className="text-lg font-semibold mb-2">Schools</h3>
        <table className="min-w-full mb-6">
          <thead>
            <tr>
              <th className="py-1">ID</th>
              <th className="py-1">Name</th>
              <th className="py-1">Email</th>
              <th className="py-1">Province</th>
            </tr>
          </thead>
          <tbody>
            {schools.map(school => (
              <tr key={school.id} className="border-t">
                <td className="py-1">{school.id}</td>
                <td className="py-1">{school.name}</td>
                <td className="py-1">{school.email}</td>
                <td className="py-1">{school.province}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h3 className="text-lg font-semibold mb-2">Users</h3>
        <table className="min-w-full">
          <thead>
            <tr>
              <th className="py-1">ID</th>
              <th className="py-1">Name</th>
              <th className="py-1">Email</th>
              <th className="py-1">Role</th>
              <th className="py-1">School</th>
            </tr>
          </thead>
          <tbody>
            {users.map(user => (
              <tr key={user.id} className="border-t">
                <td className="py-1">{user.id}</td>
                <td className="py-1">{user.full_name}</td>
                <td className="py-1">{user.email}</td>
                <td className="py-1">{user.role}</td>
                <td className="py-1">{user.school_id || ''}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
